	(*amatch_avl)(unsafe.Pointer(pP)).FpAfter = pY
	if pY != 0 {
		(*amatch_avl)(unsafe.Pointer(pY)).FpUp = pP
	}
	amatchAvlRecomputeHeight(tls, pP)
	amatchAvlRecomputeHeight(tls, pA)
